<!DOCTYPE html>
<html lang="ru">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta name="author" content="https://github.com/zaytsevaleksandrv/training">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Форма</title>
  <link rel="stylesheet" href="css/style.css">
  <link href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700" rel="stylesheet">
</head>
<body>
  <header id="header">
    <h1 id="h1">Форма</h1>
    <a id="back" href="./index.html">Назад</a>
  </header>
  <main id="main">
    <form action="" id="form">
      <fieldset id="fieldset">
        <legend id="legend">Форма всех</legend>
        <div id="textBlock">
          <label for="text">text</label>
          <input id="text" name="text" type="text" placeholder="text" required>
        </div>
        <div id="numberBlock">
          <label for="number">number</label>
          <input id="number" name="salary" type="number" placeholder="number" required>
        </div>
        <div id="buttonBlock">
          <label for="button">button</label>
          <input id="button" name="button" type="button" value="button">
        </div>
        <div id="checkboxBlock">
          <label for="check">checkbox</label>
          <input id="check" name="check" type="checkbox">
        </div>
        <div id="radioBlock">
          <label for="radio">radio</label>
          <input id="radio" name="radio" type="radio">
        </div>
        <div id="fileBlock">
          <label for="file">file</label>
          <input id="file" name="file" type="file">
        </div>
        <div id="hiddenBlock">
          <label for="hidden">hidden</label>
          <input id="hidden" name="hidden" type="hidden">
        </div>
        <div id="imageBlock">
          <label for="image">image</label>
          <input id="image" name="image" type="image">
        </div>
        <div id="passwordBlock">
          <label for="password">password</label>
          <input id="password" name="password" type="password" required>
        </div>
        <div id="resetBlock">
          <label for="reset">reset</label>
          <input id="reset" name="reset" type="reset">
        </div>
        <div id="submitBlock">
          <label for="submit">submit</label>
          <input id="submit" name="submit" type="submit">
        </div>
        <div id="colorBlock">
          <label for="color">color</label>
          <input id="color" name="color" type="color">
        </div>
        <div id="dateBlock">
          <label for="date">date</label>
          <input id="date" name="date" type="date">
        </div>
        <div id="datetimeBlock">
          <label for="datetime">datetime</label>
          <input id="datetime" name="datetime" type="datetime">
        </div>
        <div id="datetime-localBlock">
          <label for="datetime-local">datetime-local</label>
          <input id="datetime-local" name="datetime-local" type="datetime-local">
        </div>
        <div id="emailBlock">
          <label for="email">email</label>
          <input id="email" name="email" type="email" required>
        </div>
        <div id="rangeBlock">
          <label for="range">range</label>
          <input id="range" name="range" type="range">
        </div>
        <div id="searchBlock">
          <label for="search">search</label>
          <input id="search" name="search" type="search" required>
        </div>
        <div id="telBlock">
          <label for="tel">tel</label>
          <input id="tel" name="tel" type="tel" required>
        </div>
        <div id="timeBlock">
          <label for="time">time</label>
          <input id="time" name="time" type="time" required>
        </div>
        <div id="urlBlock">
          <label for="url">url</label>
          <input id="url" name="url" type="url" required>
        </div>
        <div id="monthBlock">
          <label for="month">month</label>
          <input id="month" name="month" type="month" required>
        </div>
        <div id="weekBlock">
          <label for="week">week</label>
          <input id="week" name="week" type="week" required>
        </div>
      </fieldset>
    </form>
